// App.js
import React from 'react';
import { BrowserRouter as Router, Route, Switch } from 'react-router-dom';
import Navigation from './Navigation';
import StudentLoginPage from './features/StudentLoginPage';
import RecruiterLoginPage from './features/RecruiterLoginPage';
import CoordinatorLoginPage from './features/CoordinatorLoginPage';
import StaffLoginPage from './features/StaffLoginPage';

function App() {
  return (
    <Router>
      <div>
        <Navigation />
        <Switch>
          <Route path="/student" component={StudentLoginPage} />
          <Route path="/recruiter" component={RecruiterLoginPage} />
          <Route path="/coordinator" component={CoordinatorLoginPage} />
          <Route path="/staff" component={StaffLoginPage} />
        </Switch>
      </div>
    </Router>
  );
}

export default App;
